import { grabImage } from "./images.js"

const canvas = document.querySelector('canvas')
const ctx = canvas.getContext('2d')
let deaths = 0

class Obj{
    constructor(x,y,w,h,type){
        this.x = x
        this.y = y
        this.w = w
        this.h = h
        this.type = type
    }
    draw(){
        ctx.drawImage(grabImage(this.type),this.x,this.y,this.w,this.h)
    }
    update(scale){
        this.x *= scale
        this.y *= scale
        this.w *= scale
        this.h *= scale
    }
}
class Trampoline extends Obj{
    constructor(x,y,w,h,type,power){
        super(x,y,w,h,type)
        this.power = power
        this.animationTimer = 0
    }
    animate(){
        this.animationTimer += 1
        const animationFrame = 1+Math.floor(this.animationTimer/30)
        if(animationFrame == 1){
            this.type = 'tp2'
            setTimeout(() => {this.animate()})
            if(this.animationTimer == 1){
                this.y-=this.h*0.3
                this.h*=1.3
            }
        }
        else{
            this.animationTimer = 0
            this.type = 'tp1'
            this.h *= (1/1.3)
            this.y+=this.h*0.3
        }
    }
    update(scale){
        super.update(scale)
        this.power *= scale
    }
}
class Portal extends Obj{
    constructor(x,y,w,h,type,link){
        super(x,y,w,h,type)
        this.linkX = link.x
        this.linkY = link.y
        this.cooldown = 0
    }
    teleport(player){
        const linkedPortal = levels[level].find(b => b.x == this.linkX && b.y == this.linkY)
        linkedPortal.cooldown = 900
        player.x = this.linkX
        player.y = this.linkY
    }
    update(scale){
        super.update(scale)
        this.linkX *= scale
        this.linkY *= scale
    }
}
class ReverseGravity extends Obj{
    constructor(x,y,w,h,type){
        super(x,y,w,h,type)
        this.cooldown = 0
    }
    reverseGravity(){
        this.cooldown = 180
        player.gravity *= -1
        player.jumpSpeed = 0.001
        player.startJumpSpeed *= -1
    }
}
