function checkForPossibleCollisions(block,level){
    const {x:x,y:y,w:w,h:h} = block
    const b1 = level.find(b => (Math.round(b.x+b.w) == Math.round(x) && Math.round(y)>=Math.round(b.y) && Math.round(b.y+b.h)>=Math.round(y+h)) || Math.round(x) == 0)
    const b2 = level.find(b => (Math.round(b.y+b.h) == Math.round(y) && Math.round(x)>=Math.round(b.x) && Math.round(b.x+b.w)>=Math.round(x+w)) || Math.round(y) == 0)
    const b3 = level.find(b => (Math.round(b.x) == Math.round(x+w) && Math.round(y)>=Math.round(b.y) && Math.round(b.y+b.h)>=Math.round(y+h)) || Math.round(x+w) == Math.round(canvas.width))
    const b4 = level.find(b => (Math.round(b.y) == Math.round(y+h) && Math.round(x)>=Math.round(b.x) && Math.round(b.x+b.w)>=Math.round(x+w)) || Math.round(y+h) == Math.round(canvas.height))
    if(b1 != undefined && b2 != undefined && b3 != undefined && b4 != undefined){
        return false
    }
    return true
}
for(let i=1; i<6; i++){
    const objects = levels[i]
    for(let o=0; o<objects.length; o++){
        objects[o].checkForCollisions = checkForPossibleCollisions(objects[o],levels[i])
    }
}
const spawnPoints = {
    1: {x:20,y:780},
    4: {x:20,y:600},
    3: {x:20,y:300},
    5: {x:20,y:780},
    2: {x:20,y:600}
}
class Player{
    constructor(cords){
        this.size = 19.9
        this.x = cords.x
        this.y = cords.y
        this.speed = 5
        this.isJumping = false
        this.gravity = 1
        this.jumpSpeed = 0
        this.time = 0
        this.startJumpSpeed = 15
        this.deathcooldown = 0
        this.updateCollidingBlocks()
        this.accuracy = 10
    }
    draw(){
        ctx.fillStyle = '#00ff00'
        ctx.fillRect(this.x,this.y,this.size,this.size)
        this.move()
        if(this.deathcooldown != 0){
            this.deathcooldown -= 1
        }
        //const blockHeight = Math.floor((canvas.height-player.y)/player.size)
        //ctx.font = '24px Arial'
        //ctx.fillText(blockHeight,50,50)
    }
    keyPress(e,bln){
        const keys = {
            'w':'up',
            'a':'left',
            'd':'right',
            ' ':'up',
            'ArrowRight':'right',
            'ArrowLeft':'left',
            'ArrowUp':'up'
        }
        if(keys[e.key] != undefined){
            this[keys[e.key]] = bln
        }
    }
    move(){
        for(let i=0; i<this.accuracy; i++){
            this.y -= this.jumpSpeed/this.accuracy*60/averagefps
            if(this.right == true){
                this.x+=this.speed/this.accuracy*60/averagefps
                if(this.x>canvas.width-this.size){
                    this.x=canvas.width-this.size
                }
            }
            if(this.left == true){
                this.x-=this.speed/this.accuracy*60/averagefps
                if(this.x<0){
                    this.x=0
                }
            }
            this.detectCollisionX()
            const isResting = this.detectCollisionY()
            if(!isResting && this.y != canvas.height-this.size && this.isJumping == false){
                this.jumpSpeed -= this.gravity/this.accuracy*60/averagefps
            }
            if(this.up == true && this.isJumping == false){
                this.jumpSpeed = this.startJumpSpeed
                this.isJumping = true
            }
            if(this.isJumping == true){
                this.jumpSpeed -= this.gravity/this.accuracy*60/averagefps
            }
            if(this.y>canvas.height-this.size){
                this.y = canvas.height-this.size
                this.isJumping = false
            }
            if(this.y<-1000){
                const g = player.gravity
                const s = player.startJumpSpeed
                const h = player.speed
                player = new Player(spawnPoints[level])
                player.update(canvas.width/1400)
                player.gravity = g
                player.startJumpSpeed = s
                player.speed = h
            }
        }
    }
    detectCollisionX(){
        for(let i=0; i<this.blocks.length; i++){
            const {x:x, y:y, w:w, h:h, type:type} = this.blocks[i]
            if(this.x<x+w && this.x+this.size>x && this.y-Math.abs(this.jumpSpeed)/this.accuracy*60/averagefps<y+h && this.y+this.size+Math.abs(this.jumpSpeed)/this.accuracy*60/averagefps>y){
                if(type == 'GrassAndDirt' || type == 'Grass' || type == 'Dirt' || type == 'tp1' || type == 'stone' || type == 'grassyStone' || type == 'tp2'){
                    const x_dist = ((this.x+this.size/2)-(x+w/2))/(w/(w+h))
                    const y_dist = ((this.y+this.size/2)-(y+h/2))/(h/(w+h))
                    if(Math.abs(x_dist)>=Math.abs(y_dist)){
                        if(x_dist<0){
                            this.x = x-this.size
                        }
                        else{
                            this.x = x+w
                        }
                    }
                }
                else if(type == 'Lava'){
                    const g = player.gravity
                    const s = player.startJumpSpeed
                    const h = player.speed
                    player = new Player(spawnPoints[level])
                    player.update(canvas.width/1400)
                    player.gravity = g
                    player.startJumpSpeed = s
                    player.speed = h
                    if(this.deathcooldown==0){
                        deaths += 1
                        this.deathcooldown = 60
                    }
                }
                else if(type == 'portal1'){
                    if(this.blocks[i].cooldown == 0){
                        this.blocks[i].teleport(this)
                    }
                    else{
                        this.blocks[i].cooldown -= 1
                    }
                }
                else if(type == 'finishFlag'){
                    if(level == 5){
                        if(levelCooldown == 0){
                            levelCooldown = 30
                            const minutes = Math.floor(time/3600)
                            const seconds = ((time-minutes*3600)/60).toFixed(2)
                            alert('Congratulations! Your time was: '+minutes+'min. & '+seconds+'sec.')
                        }
                    }
                    else{
                        fpsTimes = []
                        if(levelCooldown == 0){
                            level+=1
                        }
                        const g = player.gravity
                        const s = player.startJumpSpeed
                        const h = player.speed
                        player = new Player(spawnPoints[level])
                        player.update(canvas.width/1400)
                        player.gravity = g
                        player.startJumpSpeed = s
                        player.speed = h
                        levelCooldown = 30
                    }
                }
                else if(type == 'reverseGravity'){
                    if(this.blocks[i].cooldown == 0){
                        this.blocks[i].reverseGravity()
                    }
                    else{
                        this.blocks[i].cooldown -= 1
                    }
                }
            }
        }
    }
    detectCollisionY(){
        for(let i=0; i<this.blocks.length; i++){
            const {x:x, y:y, w:w, h:h, type:type} = this.blocks[i]
            if(this.x<x+w && this.x+this.size>x && this.y-Math.abs(this.jumpSpeed)/this.accuracy*60/averagefps<y+h && this.y+this.size+Math.abs(this.jumpSpeed)/this.accuracy*60/averagefps>y){
                if(type == 'GrassAndDirt' || type == 'Grass' || type == 'Dirt' || type == 'stone' || type == 'grassyStone'){
                    const x_dist = ((this.x+this.size/2)-(x+w/2))/(w/(w+h))
                    const y_dist = ((this.y+this.size/2)-(y+h/2))/(h/(w+h))
                    if(Math.abs(x_dist)<Math.abs(y_dist)){
                        if(y_dist<0){
                            if(this.jumpSpeed<=0){
                                this.y = y-this.size
                                this.jumpSpeed = 0
                                if(this.gravity>0){
                                    this.isJumping = false
                                }
                                return true
                            }
                            
                        }
                        else{
                            this.y = y+h
                            this.jumpSpeed = 0
                            if(this.gravity<0){
                                this.isJumping = false
                            }
                        }
                    }
                }
                else if(type == 'Lava'){
                    const g = player.gravity
                    const s = player.startJumpSpeed
                    const h = player.speed
                    player = new Player(spawnPoints[level])
                    player.update(canvas.width/1400)
                    player.gravity = g
                    player.startJumpSpeed = s
                    player.speed = h
                    if(this.deathcooldown==0){
                        deaths += 1
                        this.deathcooldown = 60
                    }
                }
                else if(type == 'tp1' || type == 'tp2'){
                    const y_dist = ((this.y+this.size/2)-(y+h/2))/(h/(w+h))
                    if(y_dist<0){
                        this.y = y-this.size-h*0.3
                        this.isJumping = false
                        this.jumpSpeed = this.blocks[i].power
                        if(this.blocks[i].animationTimer == 0){
                            this.blocks[i].animate()
                        }
                    }
                    else{
                        this.y = y+h
                        this.jumpSpeed = 0
                    }
                }
                else if(type == 'portal1'){
                    if(this.blocks[i].cooldown == 0){
                        this.blocks[i].teleport(this)
                    }
                    else{
                        this.blocks[i].cooldown -= 1
                    }
                }
                else if(type == 'finishFlag'){
                    if(level == 5){
                        if(levelCooldown == 0){
                            levelCooldown = 300
                            const minutes = Math.floor(time/3600)
                            const seconds = ((time-minutes*3600)/60).toFixed(2)
                            alert('Congratulations! Your time was: '+minutes+'min. & '+seconds+'sec.')
                        }
                    }
                    else{
                        fpsTimes = []
                        if(levelCooldown == 0){
                            level+=1
                        }
                        const g = player.gravity
                        const s = player.startJumpSpeed
                        const h = player.speed
                        player = new Player(spawnPoints[level])
                        player.update(canvas.width/1400)
                        player.gravity = g
                        player.startJumpSpeed = s
                        player.speed = h
                        levelCooldown = 30
                    }
                }
                else if(type == 'reverseGravity'){
                    if(this.blocks[i].cooldown == 0){
                        this.blocks[i].reverseGravity()
                    }
                    else{
                        this.blocks[i].cooldown -= 1
                    }
                }
            }
        }
    }
    update(scale){
        this.size *= scale
        this.x *= scale
        this.y *= scale
        this.speed *= scale
        this.gravity *= scale
        this.startJumpSpeed *= scale
    }
    updateCollidingBlocks(){
        this.blocks = levels[level].filter(b => b.checkForCollisions == true)
    }
}
let level = 1
let time = 0
let player = new Player(spawnPoints[level])
let levelCooldown = 0
let renderLimitations = false
let renderDistance = 500
let timer = 0
let fps = 0
let fpsTimes = []
let averagefps = 60

function mainLoop(){
    timer += 1
    ctx.drawImage(grabImage('background'),0,0,canvas.width,canvas.height)
    player.draw()
    levels[level].forEach(o => {if(renderLimitations == true){
        const xDiff = (player.x-o.x)
        const yDiff = (player.y-o.y)*(14/8)
        const dist = Math.sqrt(Math.pow(xDiff,2)+Math.pow(yDiff,2))
        if(dist<renderDistance){
            o.draw()
        }
    }
    else{o.draw()}})
    time += 60/averagefps
    if(levelCooldown != 0){
        levelCooldown -= 1
    }
    ctx.font = '24px Arial'
    ctx.fillStyle = '#ff0000'
    ctx.fillText('Deaths: '+deaths,canvas.width-150,50)
    ctx.fillText('FPS: '+Math.round(averagefps),50,50)
    requestAnimationFrame(mainLoop)
}
mainLoop()

function resize(){
    const currentWidth = canvas.width
    const w2 = window.document.defaultView.innerWidth-20
    const h2 = window.document.defaultView.innerHeight-20
    const ratio = (h2*14/8)/w2
    if(ratio>1){
        canvas.height = w2/(14/8)
        canvas.width = w2
    }
    else{
        canvas.width = h2*(14/8)
        canvas.height = h2
    }
    const scale = canvas.width/currentWidth
    player.update(scale)
    for(let i=1; i<6; i++){
        levels[i].forEach(o => o.update(scale))
    }
    renderDistance*=scale
}
resize()

window.addEventListener('resize',resize)
window.addEventListener('keydown',function(e){
    player.keyPress(e,true)
    if(e.key == 'm' && player.gravity>0.25){
        player.gravity *= 0.9
        const originalSpeed = player.startJumpSpeed
        player.startJumpSpeed = Math.sqrt(player.gravity*2*112.5*(canvas.width/1400))
        player.speed = (5*player.startJumpSpeed/(15*(canvas.width/1400)))*(canvas.width/1400)
        for(let i=1; i<6; i++){
            const objects = levels[i]
            objects.forEach(t => {
                if(t.power != undefined){
                    t.power *= player.startJumpSpeed/originalSpeed
                }})
        }
    }
    if(e.key == 'n' && player.gravity<2){
        player.gravity *= 1.1
        const originalSpeed = player.startJumpSpeed
        player.startJumpSpeed = Math.sqrt(player.gravity*2*112.5*(canvas.width/1400))
        player.speed = (5*player.startJumpSpeed/(15*(canvas.width/1400)))*(canvas.width/1400)
        for(let i=1; i<6; i++){
            const objects = levels[i]
            objects.forEach(t => {
                if(t.power != undefined){
                    t.power *= player.startJumpSpeed/originalSpeed
                }})
        }
    }
    if(e.key == 'r'){
        if(renderLimitations == false){
            renderLimitations = true
        }
        else{
            renderLimitations = false
        }
    }
    if(e.key == 'q' && renderDistance<1000*(canvas.width/1400)){
        renderDistance += (canvas.width/1400)*50
    }
    if(e.key == 'e' && renderDistance>250*(canvas.width/1400)){
        renderDistance -= (canvas.width/1400)*50
    }
})
window.addEventListener('keyup',function(e){
    player.keyPress(e,false)
})
